import React from 'react'
import './Card.css'
import moreAction from '../imgs/more-action.PNG'

const Card = () => {
  return (
    // <div className='row'>
        // <div>  {/* className="col-4"     */}
            <div className="card shadow-sm">
                <div className="card-body px-2">
                    <div className="row">
                        <div className="col-6 d-flex ">
                            <img className='profile-pic' alt='Profile' src='https://images.unsplash.com/photo-1511739001486-6bfe10ce785f?w=500&auto=format&fit=crop&q=60&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHx0b3BpYy1mZWVkfDYzfEZ6bzN6dU9ITjZ3fHxlbnwwfHx8fHw%3D' />
                            <div className="mt-2">
                                <p className="fs-6 fw-bold">Title</p>
                                <p>Description</p>
                            </div>
                        </div>
                        <div className="col-6">
                            <img className="float-end fs-3 p-2 mt-3" src={moreAction} alt='more action'/>
                        </div>
                    </div>
                </div>
            </div>
        // </div>
    // </div>
  )
}

export default Card
